import Square from "./Square";

function Attributes(props) {
  return (
    <div id="Attributes">
      <div id="first">
        <Square color="#60a569" />
      </div>
      <div id="first">
        <Square color="#f44336" id="second" />
      </div>
    </div>
  );
}
export default Attributes;
